    classes_mapping = ["" for _ in range(1000)]
    for i, (c, l) in imagenet_classes_mapping.items():
        classes_mapping[int(i)] = [c, openai_en_classes[int(i)]]
    class2label = {c: l for (c, l) in classes_mapping}

    label2paths = defaultdict(list)
    for j, class_id in enumerate(class2label.keys()):
        label = class2label[class_id]
        class_path = os.path.join(root, class_id)
        if not os.path.isdir(class_path):
            print(f"Could not find folder {class_id} in {root}. Please make sure you downloaded ImageNet and 'image_root' points to the val/ folder.")
            print("You can ignore this error for ImageNet-A/R which only cover 200/1000 classes.")
            continue
        for file in os.listdir(class_path):
            label2paths[label].append(os.path.join(class_id, file))
    return label2paths


