def load_imagenet6k(root, lex, max_examples=10):
    #max examples here for early reduction before option generation
    wnid2label = imagenet6k_lex[lex]

    label2paths = defaultdict(list)
    for wnid, label in wnid2label.items():
        class_path = os.path.join(root, wnid)
        if not os.path.isdir(class_path):
            print(
                f"Could not find folder {wnid} in {root}.")
            continue
        for file in os.listdir(class_path):
            if len(label2paths[label]) >= max_examples:
                continue
            label2paths[label].append(os.path.join(class_path, file))
    return label2paths



#adapted from torchvision.datasets.Food101
def load_food101(root):
    _base_folder = Path(root) # / "food-101"
    _meta_folder = _base_folder / "meta"
    _images_folder = _base_folder / "images"

    split = "test"

    label2paths = defaultdict(list)
    with open(_meta_folder / f"{split}.json") as f:
        metadata = json.loads(f.read())

    for class_label, im_rel_paths in metadata.items():
        label = class_label.replace("_", " ")

        image_files = [
            f"images/{im_rel_path}.jpg" for im_rel_path in im_rel_paths
        ]
        label2paths[label].extend(image_files)
    return label2paths


