#Adapted from torchvision.datasets.OxfordIIIPet
def load_oxford_pet(root):
    _split = "test" #verify_str_arg(split, "split", ("trainval", "test"))

    _base_folder = Path(root)  #/ "oxford-iiit-pet"
    _images_folder = _base_folder / "images"
    _anns_folder = _base_folder / "annotations"
    _segs_folder = _anns_folder / "trimaps"

    image_ids = []
    _labels = []
    with open(_anns_folder / f"{_split}.txt") as file:
        for line in file:
            image_id, label, *_ = line.strip().split()
            image_ids.append(image_id)
            _labels.append(int(label) - 1)

    classes = [
        " ".join(part.title() for part in raw_cls.split("_"))
        for raw_cls, _ in sorted(
            {(image_id.rsplit("_", 1)[0], label) for image_id, label in zip(image_ids, _labels)},
            key=lambda image_id_and_label: image_id_and_label[1],
        )
    ]
    class_to_idx = dict(zip(classes, range(len(classes))))

    _images = [f"images/{image_id}.jpg" for image_id in image_ids]

    label2paths = defaultdict(list)
    for label, img in zip(_labels, _images):
        label2paths[classes[label]].append(img)
    return label2paths

