def load_geode(root):
    from csv import DictReader
    label2paths = defaultdict(list)
    with open(f"{root}/index.csv") as f:
        reader = DictReader(f)
        for row in reader:
            img = f'images/{row["file_path"]}'
            label = row["object"].replace("_", " ")
            label2paths[label].append(img)
    return label2paths


